import React from "react";
import { FaFacebookF, FaLinkedinIn, FaTwitter } from "react-icons/fa";

let teamData = [
  {
    images: "01",
    name: "Brigadier(Retd) Sajjad Sardar ",
    title: "Core Member",
    designation: "Space Scientist",
    socialNetwork: [
      {
        icon: <FaFacebookF />,
        url: "#",
      },
      {
        icon: <FaLinkedinIn />,
        url: "#",
      },
      {
        icon: <FaTwitter />,
        url: "#",
      },
    ],
  },
  {
    images: "02",
    name: "Dr Syed Ali Raza",
    title: "Core Member",
    designation: "Expertise in Artificial Intelligence",
    socialNetwork: [
      {
        icon: <FaFacebookF />,
        url: "#",
      },
      {
        icon: <FaLinkedinIn />,
        url: "#",
      },
    ],
  },
  {
    images: "03",
    name: "Dr Jamil H Kazmi",
    title: "Core Member",
    designation: "Meritorious Professor and a seasoned Geographe",
    socialNetwork: [
      {
        icon: <FaFacebookF />,
        url: "#",
      },
      {
        icon: <FaLinkedinIn />,
        url: "#",
      },
      {
        icon: <FaTwitter />,
        url: "#",
      },
    ],
  },
  {
    images: "04",
    name: "Syed Wajahat Hussain",
    title: "Core Member",
    designation:
      "An engineer with experience of over thirty years in Product Development",
    socialNetwork: [
      {
        icon: <FaFacebookF />,
        url: "#",
      },
      {
        icon: <FaLinkedinIn />,
        url: "#",
      },
      {
        icon: <FaTwitter />,
        url: "#",
      },
    ],
  },
];

// into TeamOne
export default teamData;
